import React from 'react';

const FlagFr = props => (
  <svg viewBox="0 0 3 2" {...props}>
    <path fill="#ED2939" d="M0 0h3v2H0z" />
    <path fill="#fff" d="M0 0h2v2H0z" />
    <path fill="#002395" d="M0 0h1v2H0z" />
  </svg>
);

export default FlagFr;
